DROP TABLE IF EXISTS itemsEjec;

CREATE TABLE itemsEjec (
    ID SERIAL PRIMARY KEY,
    DescripcionItem VARCHAR(50) NOT NULL,
    CantidadItem DECIMAL(5, 2) NOT NULL,
    Subregion VARCHAR(25) NOT NULL,
    Municipio VARCHAR(50) NOT NULL,
    MpCode INT NOT NULL,
    Latitud_Y DECIMAL(16, 14) NOT NULL,
    Longitud_X DECIMAL(16, 14) NOT NULL,
    tierras DECIMAL(17, 15) NOT NULL,
    areaTierras INT NOT NULL,
    roca DECIMAL(17, 15) NOT NULL,
    areaRoca INT NOT NULL,
    concreto DECIMAL(17, 15) NOT NULL,
    areaConcreto INT NOT NULL,
    pavimento DECIMAL(17, 15) NOT NULL,
    areaPavimento INT NOT NULL
);

